import { CloseIcon } from '../../../shared/icons/CloseIcon';
import css from './card.module.scss';

export const Card = (props)=>{
	return (
		<div className = {css.card}>
			<span>props.name</span>
			<Button className={css['button-remove']} onClick={
				(e)=>{
					removeTask(props.id);
					e.stopPropagation();
				}}>

				</Button>
			}
			<CloseIcon />
		</div>
	)
}
